import React, { Component } from 'react'
import Box from './Box'

class App extends Component{


  render(){

    const info = [
      {name : "Ali" ,    age : 23},
      {name : "John",    age : 54},
      {name : "Adam",    age : 66},
    ]
    const displayingInfo = info.map( person =>{
      return <Box
      name = {person.name}
      age  = {person.age }
      />
    })

    return(
      <div className='mio'>
        Name: {displayingInfo}

      </div>
    )
  }


}


export default App
